import React from 'react';
import './App.css';

export default class RandomGenerate extends React.Component {


  render () {


    return(
      <div className="full-page">
        <div className="header">
        <input type="string" className="input-top"/>
        <input type="string" className="input-bottom"/>
        <input type="number" className="input-font-size"/>
        <button type="button" id="random-generate"> Random </button>
        </div>
        <div className="slider">
          <div className="top-text">
            <span>asdadadasdasdasdsadas</span>
          </div>
          <div className="photo">
            <img src="https://images.unsplash.com/photo-1566728618788-11b888adb6b6?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1312&q=80" />
          </div>
          <div className="bottom-text">
          <span>asdadadasdasdasdsadas</span>
          </div>
        </div>
      </div>
    );
  }
}
